import './App.css';
import { EncabezadoComponente } from './componentes/EncabezadoComponente';
import { LogoComponente } from './componentes/LogoComponente';
import { NavComponente } from './componentes/NavComponente';

function App() {
  return (
    <div>
      <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.1.1/dist/css/bootstrap.min.css" rel="stylesheet"></link>
      <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.1.1/dist/js/bootstrap.bundle.min.js"></script>
        <EncabezadoComponente></EncabezadoComponente>
    </div>
  );
}

export default App;
